import React, {Component} from 'react';
//import './home.css';
import Head from "../headerfooter/Header";
import Footer from "../headerfooter/Footer";
import Title from './Title';
import Introduce from './Introduce';


class Home extends Component{
    render() {
        return (
            <div>
                <Head/>
                <Title/>
                <Introduce/>
                <Footer/>
            </div>
        )
    }
}

export default Home;
